javascript:(function(){class Util{static sleep(t){return new Promise((e=>setTimeout(e,t)))}static waitForElement(t){return new Promise((function(e){let a=document.querySelector(t);if(a)return e(a);let n=new MutationObserver((function(){a&&(n.disconnect(),e(a))}));n.observe(document.body,{childList:!0,subtree:!0})}))}}class ONTPasswordChanger{static terminate(){throw alert("Program dihentikan."),new Error("Program dihentikan.")}static promptPassword(){let t="";do{t=prompt("Masukkan password yang baru:"),t||this.terminate(),t.length<8&&alert("Password harus terdiri dari minimal 8 karakter!")}while(t.length<8);return prompt(`Password hotspot akan diganti dengan "${t}".\nYakin ingin melanjutkan?`,"ya")||this.terminate(),t}static async navigateToInputPassword(){document.getElementById("first_menu_network").click(),await Util.waitForElement("#thr_security"),await Util.sleep(1500),document.getElementById("thr_security").click(),await Util.waitForElement("div.content > iframe"),await Util.sleep(2e3)}static async changePassword(t){let e=document.querySelector("div.content > iframe").contentWindow;e.document.getElementById("PreSharedKey").value=t,e.document.getElementById("wireless_apply").click()}}async function main(){if(!window.location.href.includes("html/main_inter.html")){let t="[ERROR]: Bukan halaman dashboard ONT!";throw alert(t),new Error(t)}let t=ONTPasswordChanger.promptPassword();await ONTPasswordChanger.navigateToInputPassword(),ONTPasswordChanger.changePassword(t)}main();})()